import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';

import { IonicModule } from '@ionic/angular';

import { PatientpagePageRoutingModule } from './patientpage-routing.module';

import { PatientpagePage } from './patientpage.page';

@NgModule({
  imports: [
    CommonModule,
    FormsModule,
    IonicModule,
    PatientpagePageRoutingModule
  ],
  declarations: [PatientpagePage]
})
export class PatientpagePageModule {}
